import "./Home.css";

const Home = () => {
  return (
    <div className="home-page">
      <div className="container">
        <h1>Welcome to Blogs Application</h1>
        <ul>
          <li>
            <a>View List of Blogs</a>
          </li>
          <li>
            <a>View List of Users</a>
          </li>
        </ul>
      </div>
    </div>
  );
};
export default Home;
